function isNumber(n) { return !isNaN(parseFloat(n)) && !isNaN(n - 0) }

function change(s) {
    s = [...s].reverse().join("");
    let ns = "";
    for (let i = 0; i < s.length; i++) {
        let a = s[i];
        if (isNumber(a)) {
            let f = s[Number(a)];
            ns = s.replace(a, f)
        }
        if (i % 2 == 0 && !isNumber(s[i])) {
            ns = ns.replace(s[i], s[i].toUpperCase())
        }


    }
    let sd = "a#34mrQf?Da";
    for (let i = 0; i < sd.length; i++) {
        ns = ns.splice(i++, 0, sd[i]);
    }

    return ns;
}
